// SPDX-License-Identifier: MIT
pragma solidity 0.8.5;

import '@openzeppelin/contracts/token/ERC20/ERC20.sol';

interface PCS2R {
    function factory() external pure returns (address);
}

interface PCS2F {
    function getPair(address tokenA, address tokenB) external view returns (address pair);
}

contract AdaPrice {
    PCS2R pcs2r = PCS2R(0x10ED43C718714eb63d5aA57B78B54704E256024E);
    PCS2F pcs2f = PCS2F(pcs2r.factory());
    address pair;
    function setPair(address token0, address token1) public {
        pair = pcs2f.getPair(token0, token1);
    }
    function viewAdd() public view returns(address) {
        return pair;
    }

}
